import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';  // Updated to use Routes instead of Switch
import LandingPage from './LandingPage';
import Calculator from './Calculator';
import './HomeScreen.css';

const HomeScreen = () => {
  return (
    <Router>
      <Routes>  {/* Updated to use Routes */}
        <Route exact path="/" element={<LandingPage />} />  {/* Updated to use element */}
        <Route path="/calculator" element={<Calculator />} />  {/* Updated to use element */}
      </Routes>
    </Router>
  );
};

export default HomeScreen;
